import Loai_San_Pham from "./Loai_San_Pham";
import HeaderLoai from "./HeaderLoai";
const SP=[
    {
      'ten': 'Loai 1',
      'ds_san_pham': [
        {
        'img': 'anh_1.jpg',
        'name': 'San Pham 1',
        'price': 50000
        },
        {
        'img': 'anh_1.jpg',
        'name': 'San Pham 2',
        'price': 40000
        },
        {
          'img': 'anh_1.jpg',
          'name': 'San Pham 3',
          'price': 40000
        },
      ]
    },
    {
      'ten': 'Loai 2',
      'ds_san_pham': [
        {
        'img': 'anh_1.jpg',
        'name': 'San Pham 11',
        'price': 50000
        },
        {
        'img': 'anh_1.jpg',
        'name': 'San Pham 12',
        'price': 40000
        },
      ]
    },
  ];
  
function IndexContentWeb()
{
  <HeaderLoai/>
    const ListSP= SP.map(function(item){
        return (
          <Loai_San_Pham data={item}/>
      );
      });

      return(
        <>

        <div class='row'> {ListSP}</div>
        </>
      )
}

export default IndexContentWeb;
